class Resume extends Component {


  render() {
    var wrapperBase = "bio-wrapper"
    var blockBase = "bio-block"
    var wrapper = "";
    var block = ""

    if(this.props.theme){
      wrapper = wrapperBase+ '-light'
      block = blockBase+ '-light'
    }
    else{
      wrapper = wrapperBase+ '-dark'
      block = blockBase+ '-dark'
    }

    return (


      <div className={wrapper}>
        <h3> who is she </h3>     
        <div className={block}>


        </div>


      </div>
    );
  }


}



 export default Bio;
